  <style>
    body {
      background-color: #f8f8f8;
    }

    a,
    a:hover,
    a:focus,
    .btn.btn-link {
      color: #990000;
    }

    tspan {
      font-family: sans-serif;
    }

    .btn.btn-default,
    .btn.btn-default:hover,
    .btn.btn-default:focus,
    .btn.btn-default:active {
      border-color: #990000;
      color: #990000;
    }

    .btn.btn-primary,
    .btn.btn-primary:hover,
    .btn.btn-primary:focus,
    .btn.btn-primary:active {
      background-color: #990000;
      border-color: #990000;
      color: #FFF;
    }

    #navigation>.wf-content .wf-inbox,
    #navigation>.wf-content .wf-navigation-wrapper {
      background-color: #565656;
    }

    #navigation>.wf-content .list-group>.list-group-heading {
      color: rgba(255, 255, 255, .5);
    }

    .dropdown-menu>li>a:hover,
    .dropdown-menu>li>a:focus,
    .dropdown-menu>li>a:active,
    .list-group a.list-group-item:hover,
    .list-group a.list-group-item:focus,
    .list-group a.list-group-item.active,
    #navigation>.wf-content>.list-group a:hover,
    #navigation>.wf-content .btn-link:hover {
      background-color: #990000;
      color: #FFF;
    }

    .wf-page-header,
    #navigation>.wf-content .list-group>.wf-logo {
      background-color: #990000;
    }

    .wf-title,
    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
      color: #990000;
    }

    .wf-page-header>.wf-logo {
      background-image: url(/image/layout_set_logo?img_id=228611&amp;t=1498671767449);
    }

    .wf-steps-2>li {
      background: #f5f5f5;
      border: 1px solid #CCC;
      color: #CCC;
    }

    .wf-steps-2>li::before {
      background: #f5f5f5;
    }

    .wf-steps-2>li.active {
      background: #FFF;
      border-color: #990000;
      color: #990000;
    }

    .wf-steps-2>li.active::before {
      background: #FFF;
      border-color: #990000;
    }
  </style>
  <style>
    .btn {
      border-width: 2px;
      border-radius: 100px;
    }

    .wf-viewport {
      left: 0;
      right: 0;
      bottom: 0;
      top: 0;
      position: fixed;
      overflow: auto;
    }

    #diagram {
      transition: transform .8s;
      transform: translateX(-100%);
      background: #FFF;
      border-right: 1px solid #CCC;
    }

    .wf-btn-diagram,
    .wf-diagram-message {
      transition: transform .6s;
    }

    .wf-diagram-opened #diagram {
      transform: translateX(0);
    }

    .wf-diagram-opened .wf-btn-diagram,
    .wf-diagram-opened .wf-diagram-message {
      transform: translateX(-150%);
    }

    .wf-started .wf-diagram-message {
      display: none;
    }

    #diagram:not(.wf-maximize)>div {
      display: flex;
      align-items: center;
      justify-content: center;
    }

    #diagram:not(.wf-maximize) svg {
      flex: 1;
    }

    #diagram:not(.wf-maximize) #minimize {
      display: none;
    }

    #diagram.wf-maximize svg {
      width: 4208px;
    }

    #diagram.wf-maximize #maximize {
      display: none;
    }

    #diagram #close {
      position: fixed;
      right: 15px;
      top: 15px;
      width: 30px;
      height: 30px;
      text-align: center;
      padding: 0;
    }

    #diagram #maximize,
    #diagram #minimize {
      position: fixed;
      right: 84px;
      top: 15px;
      padding: 11px 14px;
    }

    #workflow>svg {
      height: 100vh;
    }

    #workflow>svg use+g {
      pointer-events: none;
    }

    .link {
      cursor: pointer;
    }
  </style>

  <script src="libraries/bootstrap/dist/js/bootstrap.min.js"></script>

  <script>
    $(function() {
      var load = function(url) {
        $('body').removeClass('wf-diagram-opened').addClass('wf-started');
        setTimeout(function() {
          $('#viewer')[0].src = url;
        }, 400);
      };
      var svgZoom = new SvgZoom('#workflow > svg', {
        mouseWheel: true,
        zoomSpeed: 0.065,
        maxZoom: Number.POSITIVE_INFINITY,
        minZoom: 0.5,
        initZoom: 1,
        center: true,
        viewClass: 'svgzoom-view',
        zoomSelector: '',
        dragCursorStyle: 'move',
        onZoomed: $.noop
      });
      var path = location.host == 'localhost:8080' ? '/cobis-ui/views/' : '/cobiscorp/cobis-ui/views/';

        $('body').addClass('wf-diagram-opened');
      });
      $('#close').on('click', function(e) {
        $('body').removeClass('wf-diagram-opened');
      });
      $('#maximize').on('click', function(e) {
        $('#diagram').addClass('wf-maximize');
      });
      $('#minimize').on('click', function(e) {
        $('#diagram').removeClass('wf-maximize');

        #5b877d70-f417-41b1-b113-adaaf777ec9c
      `).on('click', function(e) {
        load('terralink-request.html');

        load('terralink-from-loan.html');

        #b602b820-c0e7-4c60-b910-c58e9e6dab43

        #44469ad5-6654-467a-a139-750d4a659b97

        #6ce384eb-fd9a-484f-86f8-bddd64bf399f

        #4b1bcd92-1112-4932-9e27-446d1f51ec19

        load(path + 'originacion/account-detail.html?error=ofac&active=indicators&indicators=ofac&actions=1&tabs=indicators,business,signers');

      //Manual ofac

        #e9a363be-f795-438e-a58e-a5fd5981cc07

      });

        #2b24862d-1280-44e4-b5e8-42220d7af8dc
      `).on('click', function(e) {
        load(path + 'originacion/account-detail.html?active=central&indicators=ofac&actions=3&tabs=indicators,business,signers,central');
      });

        #7147f473-ef9b-4722-aef9-4b7521524323

        load(path + 'originacion/account-detail.html?active=central&actions=3&tabs=indicators,business,signers,documents,central');
      });

      //Manual Global Validation
      $(`
        #5258d42b-a361-461c-8c91-c5f19132fde4
      `).on('click', function(e) {
        load(path + 'originacion/account-detail.html?active=documents&actions=5&tabs=account-new,indicators,business,signers,documents');
      });

      // Registro de rechazo automático
      $(`
        #db217c94-d58c-4f57-aab9-25c06e393358
      `).on('click', function(e) {
        load(path + 'originacion/account-detail.html?active=indicators&actions=3&tabs=indicators,business,signers,documents&status=Rejected');

      $(`

        load(path + 'originacion/account-detail.html?active=documents&adddocuments=true&actions=5&tabs=account-new,indicators,business,signers,documents&documentStatus=A');

      ).on('click', function(e) {

      //Email request denied

        `
        #13a797a7-fa1c-4015-a792-2304233c8fcf,
        #747103cb-9290-45d4-81bb-a50c704401c7,
        #67e9817e-5814-407b-bd88-8ee16691878f,

        #df3ac711-edff-4081-bd5a-7750b55b8be0

      // RULES

      $(`

      `).on('click', function(e) {
